INSERT INTO `catalog_marketing_field` (`catalog_marketing_field_id`, `title`, `description`, `type`, `data`, `order_number`, `feedback`, `create_date`, `status`) VALUES
(1, 'Tu marketing va enfocado a:', '', 'info', '[\n    {\n        \"type\":\"radio\",\n        \"name\":\"direction\",\n        \"id\":\"business\",\n        \"value\":\"business\",\n        \"selected\":\"\",\n        \"class\":\"form-check-input\",\n        \"label\" : {\n            \"class\" : \"form-check-label\",\n            \"title\" : \"Negocio\",\n            \"for\" : \"business\"\n        }\n    },\n    {\n        \"type\":\"radio\",\n        \"name\":\"direction\",\n        \"id\":\"self\",\n        \"value\":\"self\",\n        \"selected\":\"\",\n        \"class\":\"form-check-input\",\n        \"label\" : {\n            \"class\" : \"form-check-label\",\n            \"title\" : \"Marca personal\",\n            \"for\" : \"self\"\n        }\n    }\n]', 1, 0, 1663615136, 1),
(2, 'Describe tu negocio o marca personal', '', 'info', '[\n    {\n        \"name\":\"description\",\n        \"type\":\"textarea\",\n        \"placeholder\":\"Escribe aqu...\",\n        \"value\":\"\",\n        \"id\":\"description\"\n    }\n]\n', 2, 0, 1663615136, 1),
(3, 'Elige 3 colores a usar en las piezas', '', 'info', '[\n  { \n    \"type\": \"color\", \n    \"class\": \"form-control form-control-color\",\n    \"id\": \"first_color\",\n    \"value\": \"\",\n    \"label\" : {\n        \"for\" : \"first_color\",\n        \"title\" : \"Primer color\",\n        \"class\" : \"form-label\"\n    }\n  },\n  { \n    \"type\": \"color\", \n    \"class\": \"form-control form-control-color\",\n    \"id\": \"second_color\",\n    \"value\": \"\",\n    \"label\" : {\n        \"for\" : \"second_color\",\n        \"title\" : \"Segundo color\",\n        \"class\" : \"form-label\"\n    }\n  },\n  { \n    \"type\": \"color\", \n    \"class\": \"form-control form-control-color\",\n    \"id\": \"third_color\",\n    \"value\": \"\",\n    \"label\" : {\n        \"for\" : \"third_color\",\n        \"title\" : \"Tercer color\",\n        \"class\" : \"form-label\"\n    }\n  }\n]\n', 4, 0, 1663615136, 1),
(4, 'Material de Referencia:', 'Sabemos que puedes haber visto alguna referencia que se acerque a lo que esperas o tienes alguna pieza anterior de tu marca que podemos tomar como base. Comprtelas!, puedes adjuntar hasta 3 archivos.', 'info', '[\n    {\n        \"type\" : \"file\",\n        \"id\" : \"material\",\n        \"name\" : \"name\",\n        \"class\" : \"form-control\",\n        \"label\" : {\n            \"for\" : \"material\",\n            \"title\" : \"Sube tus archivos\",\n            \"class\" : \"form-label\"\n        }\n    }\n]', 5, 0, 1663615136, 1),
(5, 'Datos a Incluir en Piezas:', 'Comprtenos toda la informacin que debe llevar la pieza. Direcciones, fechas, textos, etc.. Ten muy presente que debe ser la informacin final, esta informacin ser usada en las piezas o caption de tus publicaciones.', 'info', '[\n    {\n        \"name\":\"include\",\n        \"type\":\"textarea\",\n        \"placeholder\":\"Escribe aqu...\",\n        \"value\":\"\",\n        \"id\":\"include\"\n    }\n]\n', 6, 0, 1663615136, 1),
(6, 'Link de redes sociales:', 'Comprtenos todas tus redes sociales que tienes activas:', 'info', '[\n    {\n        \"type\" : \"text\",\n        \"id\" : \"facebook\",\n        \"name\" : \"facebook\",\n        \"value\" : \"\",\n        \"class\" : \"form-control\",\n        \"label\" : {\n            \"for\" : \"facebook\",\n            \"title\" : \"Facebook\",\n            \"class\" : \"form-label\"\n        }\n    },\n    {\n        \"type\" : \"text\",\n        \"id\" : \"instagram\",\n        \"name\" : \"instagram\",\n        \"value\" : \"\",\n        \"class\" : \"form-control\",\n        \"label\" : {\n            \"for\" : \"instagram\",\n            \"title\" : \"Instagram\",\n            \"class\" : \"form-label\"\n        }\n    },\n    {\n        \"type\" : \"text\",\n        \"id\" : \"tiktok\",\n        \"name\" : \"tiktok\",\n        \"value\" : \"\",\n        \"class\" : \"form-control\",\n        \"label\" : {\n            \"for\" : \"tiktok\",\n            \"title\" : \"TikTok\",\n            \"class\" : \"form-label\"\n        }\n    },\n    {\n        \"type\" : \"text\",\n        \"id\" : \"other\",\n        \"name\" : \"other\",\n        \"value\" : \"\",\n        \"class\" : \"form-control\",\n        \"label\" : {\n            \"for\" : \"other\",\n            \"title\" : \"Otro\",\n            \"class\" : \"form-label\"\n        }\n    }\n]\n', 7, 0, 1663615136, 1),
(7, 'Post 1', 'Describe tu pulicacin o escribe el contenido que debe ir en la pieza.', 'post', '[\n    {\n        \"type\":\"textarea\",\n        \"name\":\"post_1\",\n        \"placeholder\":\"Escribe aqu...\",\n        \"value\":\"\",\n        \"id\":\"post_1_text\"\n    },\n    {\n        \"type\" : \"file\",\n        \"id\" : \"post_1\",\n        \"name\" : \"post_1\",\n        \"class\" : \"form-control\",\n        \"label\" : {\n            \"for\" : \"post_1\",\n            \"title\" : \"Sube tu archivo\",\n            \"class\" : \"form-label\"\n        },\n        \"buttons\" : [\n            {\n                \"type\" : \"button\",\n                \"id\" : \"save_post_\",\n                \"class\" : \"btn btn-primary mb-0 shadow-none\",\n                \"text\" : \"Guardar\",\n                \"method\" : \"save\"\n            }\n        ]\n    }\n]\n', 1, 1, 1663615136, 1),
