INSERT INTO `faq` (`faq_id`, `title`, `description`, `catalog_subtopic_id`, `create_date`, `status`) VALUES
(1, 'Como editar tu email?', '<div class=\"mb-3\">\n    Para editar tu correo electrnico es necesario te comuniques con nosotros a travs de nuestro WhatsApp, ten en cuenta que pediremos informacin necesaria para validar tu identidad\n</div>', 1, 1663615136, 1),
(4, 'Por qu no ha llegado mi rendimiento?', '<div class=\"mb-3\">\r\n    El tiempo de espera de dispersin de comisiones de 30 minutos mximo, cada media hora dispersamos dinero a las ewallets de nuestros socios. Si tu comisin an est pendiente de dispersin por favor contacta con nosotros.\r\n</div>', 3, 1663615136, 1),
(2, 'Cmo cambiar tu patrocinador?', '<div class=\"mb-3\">\n    Para editar tu patrocinador es necesario te comuniques con nosotros a travs de nuestro WhatsApp, ten en cuenta que pediremos informacin necesaria para validar tu identidad\n</div>\n', 2, 1663615136, 0),
(3, 'Cmo editar mi informacin?', '<div class=\"mb-3\">\n    Para actualizar la informacin bsica de tu perfil da clic <a href=\"https://www.funnels7.com/apps/backoffice/profile\">aqu</a>\n</div>', 4, 1663615136, 1),
(5, 'Por qu no se genero mi comisin?', '<div class=\"mb-3\">\r\n    Es necesario que valides que el plan de pagos al cual ests haciendo referencia no tenga reglas importantes como el que ests activo en el plan especificado o se tengan que cumplir ciertos requisitos. Si ests completamente seguro de esto puedes contactarte con nosotros\r\n</div>', 5, 1663615136, 1),
(6, 'Mi comisin tiene un monto mayor o menor (es erroneo)', '<div class=\"mb-3\">\n    Si tu comisin es errone te pedimos te contactes con nosotros para realizar el ajuste\n</div>', 6, 1663615136, 1),
(7, 'Mi compra no esta aprobada pero ya realice el pago', '<div class=\"mb-3\">\r\n    Si ya te descontamos tu dinero por cualquier medio y an no est aprobada tu compra te pedimos nos contactes para poder apoyarte\r\n</div>', 7, 1663615136, 1),
(8, 'Compra eliminada por error', '<div class=\"mb-3\">\n    Si tu compra fue eliminada y la intentabas realizar, puedes realizar otra con los mismos elementos.\n</div>', 7, 1663615136, 1),
(9, 'Hicieron un cargo no reconocido', '<div class=\"mb-3\">\r\n    Si tienes algn cargo no reconocido en tu cuenta, por favor contacta con nosotros para poder ayudarte\r\n</div>', 7, 1663615136, 1);
