(13, 5, '<p>Buen da seor Alejandro,</p><p><br></p><p>El da de ayer la sra Marial del Pilar se comunic con soporte manifestando dicha situacin. No conocemos la razn de dicho error, seguramente fue un inconveniente manual al transferir los datos de nuestro antiguo al nuevo backoffice, en el transcurso del da ya debera estar solucionado y deberas pertenecer al equipo de la sra Maria del Pilar, estos cambios solo se hacen en situaciones excepcionales, queremos evitar los problemas que mas se presentan en las redes de mercadeo con la disputa por referidos y evitar malentendidos futuros, agradecemos la comprensin mostrada y solicitamos que revises si el problema ya ha sido resulto, en caso de no obtener solucin por favor comuncate nuevamente por este medio.</p>', 7, 1, 1688058152, 1),
(14, 6, '<p>Me aparece usuario inactivo y no aparece la persona que me Patrocina como hago para que aparezca </p>', 0, 0, 1688183570, 1),
