(19, 11, '<p>Me aparece usuario inactivo y no aparece la persona que me Patrocina como hago para que aparezca </p>', 0, 0, 1688183570, 1),
(20, 12, '<p>Me aparece usuario inactivo y no aparece la persona que me Patrocina como hago para que aparezca </p>', 0, 0, 1688183571, 1),
