(28, 14, '<p>hola muy buenas tardes, de ante mano agradecer por esta comunidad que crearon, se que ser de gran ayuda para muchos que no tenemos accesos a esta educacin de manera paga, y que ustedes abren una puerta muy grande en este aprendizaje, quera saber como hago para ingresar al grupo de telegram del material de apoyo donde estn subiendo el material gravado, ya que en la pagina no e podido ingresar sino solo al grupo de seales y el grupo oficial de Unlimited donde envan los zoom.</p>', 0, 0, 1689096337, 1),
(29, 14, '<p>Buenos Das seor Anderson an no estn disponibles las clases, el equipo de programacin est trabajando para aadir una nueva sesin en nuestro Backoffice donde prximamente podrs acceder a este contenido. </p>', 6, 1, 1689952636, 1),
(30, 15, '<p>Gracias por el buen servicio de soporte</p>', 0, 0, 1690057585, 1),
(31, 16, '<p>Hola hice retiro y no llega</p><p><br></p><p>saudos</p>', 0, 0, 1693359478, 1),
(32, 17, '<p>Buenos das mi nombre es Daniel y quera averiguar por las clases grabadas ya estn en la plataforma pero le doy inicio y no sale nada mi pregunta es soy el nico o todava no estn disponibles </p>', 0, 0, 1694014379, 1),
(33, 18, '<p>Buenas tardes he realizado un retiro hace una semana y an no me llega el deposito de 50 usdt, cabe precisar que el retiro fue por criptos usdt por la red trc20,</p><p>Espero su pronta respuesta, </p><p>Gracias..</p><p><br></p><p>Fernando Zrate.</p>', 0, 0, 1694620528, 1),
(34, 19, '<p>El link que me fue asignado no esta activo para que pueda registrar mas personas</p>', 0, 0, 1694661736, 1),
(35, 19, '<p>Hola Sergio, revisamos tu caso y el punto(.) en el link estaba creando una inconsistencia, decidimos modificarlo al siguiente. si estas de acuerdo o nos puedes proporcionar otra opcin para arreglarlo. </p><p><br></p><p>el nuevo link es https://www.unlimited.com/ingsergioarenas</p><p><br></p><p>Fue un gusto atenderte</p><p><br></p><p>El equipo de soporte de Unlimited</p>', 2, 1, 1694750597, 1),
(36, 18, '<ul><li>Hola Fernando buenos das, queremos informarte que revisamos tu wallet de Unlimited y no tienes ningn retiro pendiente; si el retiro es del brker aliado debes escribir al soporte de ellos en tu oficina virtual del brker. Te enviamos un correo para que les puedas escribir </li><li><a href=\"mailto:support@exma-trading.com%20\" target=\"_blank\" style=\"color: blue;\">Correo electrnico :soporte@exma-trading.com</a></li></ul><p><br></p><p>Espero haber solucionado tu inquietud.</p><p><br></p><p>El equipo de soporte de Unlimited</p><p><br></p><p><br></p>', 2, 1, 1694751252, 1),
(37, 17, '<p>Hola Daniel buenos dias, queremos informarte que ya cuentas con las clases grabadas en tu oficina virtual a travez del men Unlimited academy y luego en cursos grabados. Te invitamos a disfrutar de los primeros videos de la academia. </p><p><br></p><p>fue un gusto atenderte</p><p><br></p><p>El equipo de soporte de Unlimited</p>', 2, 1, 1694752112, 1),
(38, 14, '<p>Hola Anderson  buenos das, queremos informarte que ya cuentas con las clases grabadas en tu oficina virtual a travs del men Unlimited academia y luego en cursos grabados. Te invitamos a disfrutar de los primeros videos de la academia. </p><p><br></p><p>fue un gusto atenderte</p><p><br></p><p>El equipo de soporte de Unlimited</p>', 2, 1, 1694752239, 1),
