INSERT INTO `reply_per_catalog_tag_intent` (`reply_per_catalog_tag_intent_id`, `catalog_tag_intent_id`, `reply`, `create_date`, `status`) VALUES
(1, 1, 'Hola! Soy el bot de Unlimited. Cmo podemos ayudarte?', 1663615136, 1),
(2, 1, 'Estamos felices de que ests ac, soy el bot de Unlimited. Cmo podemos ayudarte?', 1663615136, 1),
(3, 1, 'Bienvenido! soy tu bot de Unlimited. Cmo podemos ayudarte?', 1663615136, 1),
(4, 2, '<p>Primero debes de ir al men Productos > Cuentas MAM y podrs crear tu cuenta desde ah.</p>\n<p>Despus autorizaremos tu cuenta y podrs fondear desde $500 dlares en adelante.</p>', 1663615136, 1),
(5, 3, 'Puedes ir al men \"Billetera Unlimited\" para ver tus comisiones o bien ir al apartado del producto y desplegar \"Ganancias\"', 1663615136, 1),
(6, 4, 'Puedes ir al men \"Comunidad\" o bien puedes dar clic <a href=\"https://t.me/+0bHlDgNSnkxjMWIx\"> aqu </a> para unirte al grupo de Marketing de Unlimited en telegram ', 1663615136, 1),
(7, 5, 'Puedes ir al men \"Perfil\" y despus en \"Ajustes\" o bien puedes dar clic <a href=\"../../apps/backoffice/profile\"> aqu </a> para visualizar los datos de tu cuenta. Tu patrocinador est en el campo \"Nombre patrocinador\"', 1663615136, 1),
(8, 6, '<div>\r\n    Te cuento de Bridge Markets\r\n</div>\r\n<p>Puedes obtener hasta 65% de comisin de por vida con un proveedor de operaciones en lnea</p>\r\n<p>Hay ms de 10 mil personas activas</p>\r\n<p>1 millon de Trades abiertos</p>\r\n<p>700 instrumentos comerciales</p>\r\n<p>Para ms informacin da clic <a href=\"../../apps/markets/\">aqu</a></p>', 1663615136, 1),
(9, 7, 'Genial, vuelve cuando quieras', 1663615136, 1),
(10, 8, '<p>Bridge funds</p>\r\n<p>Adquiere tu cuenta y recibe el 80% de las ganancias desde el primer da</p>\r\n<p>Puedes hacer copy trading</p>\r\n<p>No tienes lmites de operaciones</p>', 1663615136, 1),
(11, 9, 'Puedes ir al men \"Productos\" y despus elegir Bridge Funds', 1663615136, 1),
(12, 10, 'Vamos a conectarte con un experto <a href=\"https://www.zuum.link/VG02FH\">Da clic aqu</a>', 1663615136, 1),
(13, 11, 'Para ver tu red o equipo debes de dar clic en el men \"Red\" y despus \"Mi equipo\" <a href=\"../../apps/multilevel\">o da clic aqu</a>', 1663615136, 1),
(14, 12, 'El costo de conexin es del 5% del valor de depositado', 1687836835, 1),
(15, 13, 'El depsito mnimo para abrir una cuenta MAM es 500 USD', 1687836984, 1),
(16, 14, 'Puedes retirar tus ganancias del 1 al 5 de cada mes directamente en bridge Markets ', 1687837043, 1),
(17, 15, 'En tus cuentas de fondeo puedes retirar del 26 al 30 de cada mes el 80% de tus ganancias', 1687837095, 1),
(18, 16, 'Unlimited es una comunidad gratuita en la que podrs estudiar trading en diferentes mercados y desarrollar habilidades de liderazgo sin membresas ni costos fijos mensuales.', 1687837158, 1),
(19, 17, 'Unlimited quiere convertirse en la primera comunidad gratuita que ms aporte valor en la industria del Network Marketing y ensear a millones de personas a crear ingresos residuales sostenidos en el tiempo.', 1687837286, 1),
(20, 18, 'Recuerda que para retirar las ganancias de Unlimited debes tener al menos un producto activo al momento del retiro.', 1687837347, 1),
(21, 19, 'Los retiros tardaran un mximo de 48 horas', 1687837456, 1),
(22, 20, 'Puedes ir al men Tickets support y radicar un ticket dndonos todos los datos del producto y el equipo de soporte lo ingresar por ti.', 1687837497, 1),
(23, 21, 'Unlimited te permite ganar comisiones acumulndolas en tu e-wallet incluso sin tener un producto activo.', 1687837533, 1),
(24, 22, 'En el panel lateral izquierdo encontrars botn comunidad y podrs acceder al canal de Telegram Unlimited OFICIAL, en donde se publicar la programacin con hora y fecha de cada clase.', 1687837574, 1),
(25, 23, 'En el panel lateral izquierdo encontrars el botn comunidad y podrs acceder al canal de Telegram Unlimited MARKETING, en donde est todo el contenido necesario sobre Unlimited para publicar en tus redes sociales.', 1687837618, 1),
(26, 24, 'En el panel lateral izquierdo encontrars el botn comunidad, ah tendrs todas las redes sociales oficiales de Unlimited.', 1687837667, 1),
(27, 25, 'Puedes comprar Marketing Basic o Marketing Pro en el men productos y comenzaras a vivir la experiencia para crecer tu marca personal o tu negocio.', 1687837699, 1),
(28, 26, 'En el panel lateral izquierdo encontrars el botn comunidad y podrs acceder al canal de Telegram SEALES Unlimited ACADEMY, nete al canal y all se publicaran las seales que los educadores darn todos los das.', 1687837751, 1),
(29, 27, 'En el panel lateral izquierdo encontrars el botn comunidad y all estar el enlace para acceder al canal de YouTube.', 1687837791, 1),
(30, 28, 'En el panel lateral izquierdo encontrars el botn comunidad y all estar el enlace para acceder al perfil oficial de Instagram.', 1687837809, 1),
(31, 29, 'En el panel lateral izquierdo encontrars el botn comunidad y all estar el nmero de telfono oficial del soporte de Unlimited.', 1687837850, 1),
(32, 30, 'En el panel lateral izquierdo encontrars el botn de red y all tendrs a tu equipo/red ', 1687837906, 1),
(33, 31, 'Puedes ir al inicio en el men y all encontrars las dos cuentas auditadas con The Bull Pro', 1687837962, 1),
(34, 32, 'Pdele a tu patrocinador que te enve el link de registro', 1687914670, 1),
(35, 32, 'Pdele a tu patrocinador que te enve el link de registro', 1687914677, 1);
